import "./Expense.css";

function ExpenseItems() {
  return (
    <div>
      <div className="expense-item">
        <div>april</div>
        <div className="expense-item__description"></div>
        <h1>Car</h1>
        <div className="expense-item__price">$200</div>
      </div>
    </div>
  );
}

export default ExpenseItems;
